// https://leetcode.com/problems/gas-station
func canCompleteCircuit(gas []int, cost []int) int {
	tt := 0
	circuit := true
	for index, gasValue := range gas {
		costToAdvance := cost[index]
		tt += (gasValue - costToAdvance)
		if tt < 0 {
			circuit = false
		}
	}
	if tt < 0 { // if tt is less than 0 there is no possible answer
		return -1
	}
	if circuit { // if it is at least 0 and the circuit was completed without depleting the tank, we found the answer at index 0
		return 0
	}
	// else keep searching for the answer, It is unique
	n := len(gas)
	for start := 1; start < n; {
		if gas[start] < cost[start] {
			start++
			continue
		}
		tt = 0
		circuit = true
		count := 0
		for index := start; count < n && circuit; index = (index + 1) % n {
			gasValue := gas[index]
			costToAdvance := cost[index]
			tt += gasValue - costToAdvance
			if tt < 0 {
				//https://leetcode.com/problems/gas-station/description/comments/1745609
				// Hint: if you start from station a and stuck at b, then you can't get to b from any station between a and b.
				start = index
				circuit = false
			}
			count++
		}
		if circuit {
			return start
		}
		start++
	}
	return -1
}
